import { useHistory } from "react-router-dom";


export default function landing() {

  return (
    <div>
      <h1>LANDING PAGE</h1>
      <button type="submit" className="btn btn-primary w-100 theme-btn mx-auto">
        Log In
      </button>
      <img src="landing_page.jpg" width='1300' height='1000'></img>
    </div>
  );
}
